import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <table>
      <thead class="grey lighten-2">
    <tr>
      <td>{data.name}</td>
    </tr>
    <td>
      <td >{data.price}</td>
    </td>
    <td>
      <td>{data.desc}</td>
    </td>
  </thead>
    </table>

  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
